import React from "react";
import LiveHelpIcon from "@material-ui/icons/LiveHelp";

const Faq = () => {
  return (
    <div className="container contact-container" style={{ marginTop: "20px" }}>
      <div className="ctitle">
        <h4>
          <LiveHelpIcon />
          FAQ's
        </h4>
      </div>
      <div className="row">
        <div
          className="col-md-5"
          style={{
            marginLeft: "25px",
            borderLeft: "2px solid gray",
            marginBottom: "20px",
          }}
        >
          <div>
            <h4>FAQs</h4>
            <p>
              Kindly check the FAQ below if you are not very familiar with the
              functioning of this website. If your query is of urgent nature and
              is different from the set of questions then please contact us at:
              Email: customerservice@bigbasket.com Call us: 1860 123 1000 Chat
              with us in-app under customer service /Need Help section from 6 am
              & 10 pm on all days including Sunday to get our immediate help If
              you are not satisfied with the resolution provided by us, then
              please write to our Grievance Officer at
              grievanceofficer@bigbasket.com.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Faq;
